import React from "react";
import "./robots";

const Card = ({ name, email, id }) => {
  return (
    <div
      className=" tc dib br3 pa3 ma2 grow bw2 shadow-5"
      style={{ backgroundColor: "#521B74" }}
    >
      <img src={`https://robohash.org/${id}?200x200`} alt="robots" />
      <div>
        <h2>{name}</h2>
        <p>{email}</p>
      </div>
    </div>
  );
};

export default Card;
